import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      main: "Main",
      servise: "Servise",
      forAs: "For as",
      contact: "Contact",
    };
    this.select = this.select.bind(this);
  }

  render() {
    return (
      <div>
        <header>
          <div onClick={this.select(this.state.main)}>{this.state.main}</div>
          <div>{this.state.servise}</div>
          <div>{this.state.forAs}</div>
          <div>{this.state.contact}</div>
        </header>
        <div>Selected:{}</div>
      </div>
    );
  }
  select() {}
}
export default App;
